import axios from 'axios';

export default class Card extends Component {

   state = {
        restaurants: [],
        styles: [],
        locations: [],
        options: {
            styles: [],
            locations: []
        }
    }

    componentDidMount() {
        axios.get(`./restaurants.json`)
          .then(res => {
            const restaurants = res.data;
